import React from 'react';

const buttonManager = () => {

    return (
    <div>
        <button>TechEd</button>
        <button>About</button>
        <button>Pricing</button>
        <button>Our Difference</button>
        <button>Contact</button>
        <button>Login</button>
        <button>Sign Up</button>
    </div>
    )
}
export default buttonManager;
